window.bookSummaryJSON = "<p>First time in trade paperback: The fourth novel in the number one <i>New York Times</i> best-selling series.</p> <p>Vampire hunter and zombie animator Anita Blake is an expert at sniffing out the bad from the good. But in <i>The Lunatic Cafe</i> - now in trade paperback for the first time - she's about to learn that nothing is ever as it seems, especially in matters of the not-so-human heart.</p> <p>Dating a werewolf with self-esteem issues is stressing Anita out. Especially when something - or someone - starts taking out the city's shapeshifters.</p>"; 
